import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom'; 
import DynamicPage from './components/DynamicPage';

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/:slug" element={<DynamicPage />} />
      </Routes>
    </Router>
  );
}

export default App;
